import React from 'react';

const Footer = () => {
  const currentYear = new Date().getFullYear();
  return (
    <footer className="site-footer">
      <p>&copy; {currentYear} Rota COP30. Desenvolvido por Alunos UNAMA.</p>
    </footer>
  );
};

export default Footer;
